import {Header} from '../components/organisms'
import MenusDummy from './db/menus.json'
import { useState } from 'react'
const { direction, items } = MenusDummy
const Page = () => {
    const [items, setItems] = useState([
        {
            "id":1,
            "title": "Issues",
            "url": "/issues"
        },
        {
            "id":2,
            "title": "Stories",
            "url": "/stories"
        },
        {
            "id":3,
            "title": "About us",
            "url": "about"
        }
    ])

    return (
        <>
        <Header items={items}/>
        <p>Home</p>
        </>
    )
}

export default Page;
